// Redirect to the given URL without Ajax, setting query string parameters as necessary
suitehelp.nonAjaxRedirect = function (url) {
    "use strict";

    var q = $("#search_textbox").val(),
        currentPane = suitehelp.getCurrentPane().attr("id").match("^[^_]*")[0];
    if (q) {
        url = suitehelp.addQueryStringToURL(url, "q", q);
    } else {
        url = suitehelp.addQueryStringToURL(url, "local", true);
    }

    if ($("body").hasClass("hide-nav")) {
        url = suitehelp.addQueryStringToURL(url, "hidenav", "true");
    }

    //Allows suitehelp to persist the glossary and index
    url = suitehelp.addQueryStringToURL(url, "nav", currentPane);

    document.location.href = url;
    return false;
};

// If a q= parameter is specified on load, perform an initial search
suitehelp.performInitialSearch = function () {
    "use strict";

    var q = suitehelp.getQueryString("q");
    if (q) {
        $("#search_textbox").val(q);
        $("#loader").hide();
        //Added to prevent the flickering when clicking between search results
        suitehelp.openCurrentLeftBarPane("search");
        suitehelp.performSearch(q);
    } else {
        suitehelp.setCurrentLeftBarPane();
    }
};

//If SuiteHelp+ is running, the search will happen with a web service call.
//Otherwise the static search will be called. 
suitehelp.performSearch = function (val) {
    "use strict";

    if (suitehelp.getQueryString("q") || suitehelp.getQueryString("local")) {
        suitehelp.checkSearch = false;
    }

    if (suitehelp.checkSearch === true) {
        suitehelp.callWebSearch(val);
    } else if (suitehelp.checkSearch === false) {
        suitehelp.processSearchResults(suitehelp.simpleSearch(val));
    } else {
        suitehelp.callCheckSearch(val);
    }
};

suitehelp.setCurrentLeftBarPane = function () {
    "use strict";

    var nameOfPane = "toc";
    $("#loader").hide();
    if (suitehelp.getQueryString("nav")) {
        nameOfPane = suitehelp.getQueryString("nav");
    }
    if ($("#" + nameOfPane + "_nav li").length || $("#" + nameOfPane + "_nav div").length) {
        suitehelp.openCurrentLeftBarPane(nameOfPane);
    } else {
        suitehelp.openCurrentLeftBarPane("toc");
    }
};

suitehelp.setUpAudienceSelector = function () {
    "use strict";

    var values,
        i;
    if ($("#audience_selector").length > 0 && $('#toc_nav li').not('[data-audience~="NONE"]').length > 0) {
        suitehelp.audience = true;
        $("#audience_selector").removeClass("hideaudience");
        values = $.map($('#audience_selector option'), function (ele) { return " " + ele.value; });
        values = values + " ";
        values = values.replace(/,/g, " ");
        $('#toc_nav li[data-audience~="ALL"]').attr("data-audience", values);
        if (suitehelp.getQueryString("selAudience")) {
            $("#audience_selector").val(suitehelp.getQueryString("selAudience"));
            suitehelp.changeAudience(false);
        } else {
            suitehelp.changeAudience(false);
        }
    } else {
        // Fill an array with all topics in the toc   
        for (i = 0; i < suitehelp.tocArray.length; i += 1) {
            suitehelp.tocObject[suitehelp.tocArray[i]] = i;
        }
    }
};

// Set up Ajax
