/*global $:true, Modernizr:true,  whLoad:true,  suitehelp:true, unescape:true, escape:true */

suitehelp.breadCrumbPos = "3";

suitehelp.closeOpenTrees = function ($currentLi) {
    "use strict";

    $("#toc_nav").find("li.open").not($currentLi.parents("li")).children("ul").slideToggle();
    $("#toc_nav").find("li.open").toggleClass("closed").toggleClass("open");
};

suitehelp.defineLeftBarEvents = function () {
    "use strict";

    // Enable click events
    $("#leftbar").on("click", '*[id*=_nav] li.open, *[id*=_nav] li.closed', function (event) {
       // Prevent event propogation from inner elements
        if (event.target.id === this.id) {
            $(this).children("ul").slideToggle();
            $(this).toggleClass("open").toggleClass("closed");
        }
    });

    $("#leftbar").on('mouseenter mouseleave', 'nav a, nav span', function () {
        $(this).parent().toggleClass("lihover");
    });

    $("#accordion").on('shown.bs.collapse', function () {
        suitehelp.scrollToCurrent(suitehelp.getCurrentPane().attr("id").match("^[^_]*")[0]);
    });
};

suitehelp.getCurrentPane = function () {
    "use strict";

    return $("#accordion").find(".in");
};

suitehelp.getDialogDimensions = function (img) {
    "use strict";

    var dialogWidth, dialogHeight;
    if (($.getDocHeight() < img.naturalHeight()) && ($.getDocWidth() < img.naturalWidth())) {
        dialogWidth = $.getDocWidth() - 100;
        dialogHeight = $.getDocHeight() - 100;
    } else if (($.getDocHeight() < img.naturalHeight()) && ($.getDocWidth() > img.naturalWidth())) {
        //Very tall
        dialogWidth = img.naturalWidth() + 60;
        dialogHeight = $.getDocHeight() - 100;
    } else if (($.getDocHeight() > img.naturalHeight()) && ($.getDocWidth() < img.naturalWidth())) {
        //Very wide
        dialogWidth =  $.getDocWidth() - 100;
        dialogHeight = img.naturalHeight() + 100;
    } else {
        dialogWidth =  img.naturalWidth() + 40;
        dialogHeight =  img.naturalHeight() + 80;
    }
    return { height: dialogHeight, width: dialogWidth };
};

suitehelp.initializeBreadCrumbs = function () {
    "use strict";

    suitehelp.breadcrumbs();
    suitehelp.showBreadcrumbsEllipse();
};

suitehelp.resizeArticlePane = function () {
    "use strict";

    var headerHeight, toolbarHeight, breadcrumbHeight;

    headerHeight = $("#header").is(":hidden") ? 0 : $("#header").outerHeight();
    toolbarHeight = $("#toolbar").is(":hidden") ? 0 : $("#toolbar").outerHeight();
    breadcrumbHeight = $("#breadcrumbs").is(":hidden") ? 0 : $("#breadcrumbs").outerHeight();

    if ($("body").css("overflow-y") === "hidden") {
        $("article").css("max-height",  $(window).height() - (headerHeight + toolbarHeight + breadcrumbHeight + 25));
    }
};

suitehelp.resizeLeftPane = function () {
    "use strict";

    var headerHeight;

    headerHeight = $("#header").is(":hidden") ? 0 : $("#header").outerHeight();

    if ($("#leftbar").css("overflow-y") === "auto") {
        $("#leftbar").css("max-height",  $(window).height() - headerHeight);
    }
    if ($("#leftbar").css("overflow-y") === "hidden") {
        $("#leftbar").css("max-height", "none");
    }
};

suitehelp.loadCustomCode = function () {
    "use strict";

    suitehelp.setupThumbNailDialog();
    suitehelp.setupChildLinks();

    // Set up Off Canvas click event 
    // Must come after urlConvert() is called
    suitehelp.setupOffCanvas();

    $(window).resize(function () {
        suitehelp.showBreadcrumbsEllipse();
        suitehelp.resizeArticlePane();
        suitehelp.resizeLeftPane();
    });

    $("#crumb_tooltip").tooltip();

    suitehelp.resizeArticlePane();
    suitehelp.resizeLeftPane();
};

suitehelp.openCurrentLeftBarPane = function (pane) {
    "use strict";

    $("#" + pane + "_pane").toggleClass("in");
};

//Format the search results for display.
suitehelp.processSearchResults = function (results) {
    'use strict';

    var html = [],
        result,
        i,
        href,
        snippet,
        removegt,
        replacegt,
        title,
        $searchPane = $("#search_pane");

    if (results.length) {
        html.push("<nav id='search_results'><ul>");
    } else {
        html.push("<div id='search_message'>Your search produced no results.</div>");
    }

    for (i = 0; i < results.length; i += 1) {
        html.push("<li id='search-");
        result = results[i];
        html.push(result.id);
        if (result.id === suitehelp.currid) {
            html.push("' class='current");
        }
        html.push("'>");
        //Go to the DOM to get the href for a particular page
        href = $('[id="toc-' + result.id + '"] > a').attr('href');
        html.push("<a href='");
        html.push(href);
        html.push("' data-suitehelp-page='internal'>");
        title = result.title.replace(/</g, "&lt;").replace(/>/g, "&gt;");
        html.push(title);

        if (result.hasOwnProperty("snippet") && result.snippet.length > 0) {
            html.push("<span class='snippet'>");
            snippet = result.snippet;
            //(<[^b\/])= all tags that don't start with <b or </
            //(<b[^>]) = all tags that start <b and are followed by another character other then >
            if (snippet.search(/(<[^b\/])|(<b[^>])/g) >= 0) {
                removegt = snippet.replace(/<b>/g, "openb").replace(/<\/b>/g, "closeb");
                replacegt = removegt.replace(/</g, "&lt;");
                snippet = replacegt.replace(/openb/g, "<b>").replace(/closeb/g, "</b>");
            }
            html.push(snippet);
            html.push("</span>");
        }
        html.push("</a></li>");
    }

    html.push(results.length ? "</ul></nav>" : "");
    $("#search_nav").html(html.join("")).ajaxify();
    $("#search_count").text(results.length);

    if ($searchPane.is(":hidden")) {
        //IE9 is the only browser that adds the "in" class with .collapse(toggle)
        $searchPane.collapse("toggle");
        if (!$searchPane.hasClass("in")) {
            suitehelp.openCurrentLeftBarPane("search");
        }
    }

    if (results.length) {
        suitehelp.highlight();
    } else {
        suitehelp.unhighlight();
    }

    suitehelp.breadcrumbs();
};

suitehelp.setRootOfBreadCrumbs = function () {
    "use strict";

    var $currentTab, homeValue;

    if (suitehelp.customizeRootBreadCrumb) {
        $currentTab = suitehelp.getCurrentPane();
        homeValue = $currentTab.attr("data-breadcrumbtext");
        $("#crumb_home_text").html(homeValue);
        $("#crumb_home").attr("title", homeValue);
        $("#crumb_home_image").alterClass("*_pane_img", $currentTab.attr("id") + "_img");
    }
};

suitehelp.setupChildLinks = function () {
    "use strict";

    $(".related-links").on("click", "dt", function () {
        $(this).next("dd").slideToggle();
    });
    $(".related-links").on("click", "strong", function () {
        $(this).next("a").slideToggle();
        $(this).parent().find("strong ~ div").slideToggle();
    });
};

suitehelp.setupOffCanvas = function () {
    "use strict";

    $('[data-toggle="offcanvas"]').click(function () {
        $('.row-offcanvas').toggleClass('active');
    });
};

suitehelp.setupSearch = function () {
    "use strict";

    $("#search_form").submit(function () {
        var val = $("#search_textbox").val();
        if (suitehelp.audience) {
            $("#audience_selector").val("ALL");
            suitehelp.changeAudience(false);
        }
        suitehelp.performSearch(val);
        return false;
    });
    $("#search_pane").collapse({"toggle": false, 'parent': "#accordion"});
};

suitehelp.setupThumbNailDialog = function () {
    "use strict";

    $("article").on("click", ".thumbnail", function () {
        var dialogDimensions = suitehelp.getDialogDimensions($(this));
        $("#thumbnailDialog img").remove();
        $("#thumbnailDialog").append('<img src="' + $(this).attr("src") + '" alt="' + $(this).attr("alt") + '">');
        $('#thumbnailDialog').dialog({
            height: dialogDimensions.height,
            width: dialogDimensions.width,
            title: suitehelp.getDialogTitle($(this)),
            position: { my: "center, top", at: "center, bottom", of: "#header"},
            modal: true
        });
    });

    $("body").on("click", ".ui-widget-overlay", function () {
        $('#thumbnailDialog').dialog("close");
    });
};

suitehelp.showBreadcrumbsEllipse = function () {
    "use strict";
    var $ellipses = $("#crumb_home").length ? $("#breadcrumbs >:nth-child(2)") : $("#breadcrumbs >:nth-child(1)"),
        eTitle = " ";

    if ($("#breadcrumbs a:hidden").length > 0) {
        $("#breadcrumbs a:hidden").each(function () {
            eTitle = eTitle + $(this).attr("title") + " / ";
            $ellipses.attr("title", eTitle);
        });
        $ellipses.show();
    } else {
        $ellipses.hide();
    }
};









